import React from "react";
import "./index.css";

export default function Avatar(){
    const srcBody = `character/body/${Math.floor(Math.random() * 17) + 1}.png`
    const srcHair = `character/hair/${Math.floor(Math.random() * 73) + 1}.png`
    const srcEyes = `character/eyes/${Math.floor(Math.random() * 24) + 1}.png`

    return (
        <div class="avatar">
            <img class="avatarComponent" src={srcBody} style={{zIndex:1}} alt="Body"/>;
            <img class="avatarComponent" src={srcEyes} style={{zIndex:2}} alt="Eyes"/>;
            <img class="avatarComponent" src={srcHair} style={{zIndex:3}} alt="Hair"/>;
        </div>
    )
}
